import React, { useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import Logo from '../Assets/logo3.png' // Adjust the import path to your actual logo file
// import { AuthContext } from '../context/AuthContext'; // Adjust the path according to your project structure
import './Navbar.css';

const Nav = () => {
//   const { isLoggedIn, setIsLoggedIn } = useContext(AuthContext);
  const navigate = useNavigate();

  const logout = () => {
    localStorage.clear();
    setIsLoggedIn(false);
    navigate('/');
  };

  return (
    <>
      <nav className="navbar">
        <div className="logo">
          <img src={Logo} alt="Logo" />
        </div>

        <ul className="nav-links">
          <li><Link to="/">Home</Link></li>
          <li><Link to="/AboutUs">About Us</Link></li>
          <li><Link to="/AriDesignscard">Products</Link></li>
          <li><Link to="/ContactUs">Contact Us</Link></li>
          {isLoggedIn ? (
            <li><button onClick={logout}>Logout</button></li>
          ) : (
            <li><Link to="/Login">Login</Link></li>
          )}
        </ul>
      </nav>
    </>
  );
}

export default Nav;
